public class Solution {
    public int[] FindMissingAndRepeatedValues(int[][] grid) {
        int n = grid.Length;
        int[] count = new int[n * n + 1];
        int[] ans = new int[2];

        // Count the frequency of each number in the grid
        for (int i = 0; i < n; i++) {
            for (int j = 0; j < n; j++) {
                count[grid[i][j]]++;
            }
        }

        // Find the repeated and missing numbers
        for (int i = 1; i <= n * n; i++) {
            if (count[i] == 2) {
                ans[0] = i; // Repeated number
            } else if (count[i] == 0) {
                ans[1] = i; // Missing number
            }
        }

        return ans;
    }
}
